import React from 'react';
import SettingButtons from './setting-button';
import ElementButtons from './element-button';
import styled from 'styled-components';

const Wrapper = styled.div`
  position: fixed;
  padding: 10px;
  bottom: 0;
  left: 0;
  background: #f4dac8;
  max-width: 100px;
`;

export default function Buttons({ sheet, data, showFontLightBox }) {
  return (
    <>
      <SettingButtons sheet={sheet} data={sheet} />
      <ElementButtons setShowFontLightBox={setShowFontLightBox} />
    </>
  );
}
